<template>
    <div>

        <section class="section pt60 pt30t pb0">
            <div class="container has-text-centered">
                <h1 class="is-inline-block is-relative mb25">
                    Scan an order in
                    <label class="transparent-label" @click="triggerSelect()"  v-if="selectedWarehouse">
                        {{ selectedWarehouse ? selectedWarehouse.name : 'loading...' }} <i class="mdi mdi-chevron-down"></i>
                    </label>
                    <select 
                        class="transparent-select" 
                        name="warehouse" 
                        v-model="selectedWarehouse"
                        @change="getOrders(selectedWarehouse._id)"
                        v-if="selectedWarehouse">
                        <option :value="warehouse" v-for="warehouse in warehouses" :key="warehouse._id" :selected="warehouse._id == selectedWarehouse._id">
                            {{ warehouse.name }}
                        </option>
                    </select>
                </h1>
            </div>
        </section>

        <section class="section">
            <div class="container">
                <div 
                    :class="[
                        'box', 'is-full-width',
                        {'oh': !order, 'p0': !order},
                        {'element-loader': loading, 'loading': loading}
                    ]">
                    <!-- <h3 class="has-text-centered m20-0">
                        Scan the QR code for your order.
                    </h3> -->
                    
                    <transition name="slide-top" mode="out-in">
                        <div v-if="!order" class="is-relative">
                            <h3 class="qr-loading">
                                QR Scanner is loading...
                            </h3>
                            <qrcode-stream @decode="onDecode"></qrcode-stream>
                        </div>
                        <div v-else>
                            <h3 class="has-text-centered m20-0">
                                Order status 
                                <span :class="[
                                    'text-uppercase',
                                    {'has-text-warning': order.status == 'PENDING'},
                                    {'has-text-info': order.status == 'IN_TRANSIT'},
                                    {'has-text-success': order.status == 'COMPLETE'},
                                    {'has-text-success': order.status == 'READY_TO_COLLECT'},
                                    {'has-text-danger': order.status == 'CANCELED'},
                                ]">
                                    <b>{{ order.status }}</b>
                                </span>
                            </h3>
                            <table class="table is-full-width" v-if="order && order.items.length > 0">
                                <thead>
                                    <tr>
                                        <td>Name</td>
                                        <td>Image</td>
                                        <td>Position</td>
                                        <td>Quantity</td>
                                        <td>Unit</td>
                                        <td>Price</td>
                                    </tr>
                                </thead>
                                <tbody>
                                    <tr v-for="(item, i) in order.items" :key="item._id">
                                        <td>
                                            <b>{{ item.name }}</b>
                                        </td>
                                        <td>
                                            <img class="small-img" :src="item.image" :alt="item.name" v-if="item.image">
                                        </td>
                                        <td>
                                            X: <i>{{ item.position ? item.position.x : 'not set' }},</i>
                                            Y: <i>{{ item.position ? item.position.y : 'not set' }}</i> <br>
                                            Shelf: <i>{{ item.position ? item.position.z : 'not set' }} </i><br>
                                        </td>
                                        <td>
                                            {{ item.quantity }}
                                        </td>
                                        <td>
                                            {{ item.unit }}
                                        </td>
                                        <td>
                                            {{ item.price }} GBP
                                        </td>
                                    </tr>
                                </tbody>
                            </table>
                        </div>
                    </transition>
                </div>

                <transition name="slide-top" mode="out-in">
                    <div class="is-flex justify-center align-center" v-if="order">
                        <a 
                            href="javascript:;"
                            class="button is-primary"
                            :disabled="order.status != 'READY_TO_COLLECT'"
                            @click="completeOrder(order._id)">

                            <span>Complete this order</span>
                        </a>
                        <a 
                            href="javascript:;" 
                            class="button is-primary is-outlined ml20"
                            @click="resetScan()">

                            <span>Scan again</span>
                        </a>
                    </div>
                </transition>
            </div>
        </section>
    </div>
</template>

<script>
import PageTitle from '~/components/PageTitle'
import axios from 'axios'
// import { QrcodeStream } from 'vue-qrcode-reader'

export default {
    components: {
        PageTitle,
        // QrcodeStream
    },
    data: function () {
        return {
            warehouses: [],
            selectedWarehouse: null,
            orders: [],
            loading: false,
            order: null,
            testOrders: [
                {
                    _id: "5c87b73b2582cf00173be901",
                    items: [
                        {
                            _id: "5c7565eea29bee5b5b8a5426",
                                image: "data:image/jpeg;base64,",
                            name: "Irn Bru (330ml can)",
                            position: {
                            x: 3,
                            y: 3,
                            z: 0
                            },
                            price: 0.65,
                            quantity: 1,
                            warehouseId: "5c755f58bfcf4c592bfd00a6"
                        }
                    ],
                    status: "PENDING",
                    timestamp: "2019-03-12T13:42:19.845Z",
                    warehouseId: "5c755f58bfcf4c592bfd00a6",
                    userId: "5c733c0244e62509bb1708c4"
                },
                {
                    _id: "5c87b73b2582cf00173be902",
                    items: [
                        {
                            _id: "5c7565eea29bee5b5b8a5426",
                            image: "data:image/jpeg;base64,",
                            name: "BANANAS",
                            position: {
                            x: 3,
                            y: 3,
                            z: 0
                            },
                            price: 0.65,
                            quantity: 1,
                            warehouseId: "5c755f58bfcf4c592bfd00a6"
                        }
                    ],
                    status: "PENDING",
                    timestamp: "2019-03-12T13:42:19.845Z",
                    warehouseId: "5c755f58bfcf4c592bfd00a6",
                    userId: "5c733c0244e62509bb1708c4"
                },
            ]
        }
    },
    methods: {
        onDecode: function (decodedString) {
            this.loading = true

            this.orders.forEach(order => {
                if (order._id == decodedString) {
                    setTimeout(() => {
                        this.order = order
                        this.loading = false
                    }, 1000)
                    return;
                }
            });

            setTimeout(() => {
                this.loading = false
            }, 1000)
        },
        resetScan: function () {
            this.order = null
        },
        completeOrder: function () {
            if (this.order.status == 'READY_TO_COLLECT') {
                // Change order status to COMPLETE 
            }
        },

        triggerSelect: function () {
            this.$refs.select.click()
        },
        filterWarehouses: function (warehouses) {
            return warehouses.filter((warehouse) => {
                return warehouse.merchantId == this.$store.state.user._id
            })
        },
        getWarehouses () {
            axios.
                get(process.env.baseUrl + '/api/warehouse/', {
                    headers: {
                        'Content-Type': 'application/json'
                    }
                })
                .then((res) => {
                    console.log("Server response: ", res);

                    // this.warehouses = res.data.warehouses
                    this.warehouses = this.filterWarehouses(res.data.warehouses)
                    this.selectedWarehouse = this.warehouses[0]
                    this.getOrders(this.selectedWarehouse._id)
                })
                .catch(function(error) {
                    console.error("Error adding document: ", error);
                });
        },
        getOrders: function (id) {
            axios.
                get(process.env.baseUrl + '/api/warehouse/' + id + '/orders', {
                    headers: {
                        'Content-Type': 'application/json',
                        'username': this.$store.state.user.username
                    }
                })
                .then((res) => {
                    console.log("Server response: ", res);
                    
                    this.orders = res.data.orders
                })
                .catch(function(error) {
                    console.error("Error adding document: ", error);
                });
        },
    },
    mounted: function () {
        this.getWarehouses()
    }
};
</script>

